CAtlArray<std::pair<int, int>> FieldMap14::VAR_DATA_MAP_CONTENT;
Map2<FieldType*, int> FieldMap14::VAR_DATA_MAP;

/**
	* Constructor.
	*
	* @param file parent file
	*/
FieldMap14::FieldMap14(ProjectFile* file)
:FieldMap(file)
{
}

/**
	* {@inheritDoc}
	*/
FieldType* FieldMap14::getFieldType(int fieldID)
{
	//ATLASSERT(FALSE);
	//return NULL;
	return FieldTypeHelper::getInstance14(fieldID);
}

/**
	* {@inheritDoc}
	*/
bool FieldMap14::useTypeAsVarDataKey()
{
	return true;
}

/**
	* {@inheritDoc}
	*/
bool FieldMap14::substituteVarDataKey(FieldType* type, int& value)
{
	// INIT_VAR_DATA_MAP
	if (VAR_DATA_MAP.GetCount() == 0)
	{
		INIT_VAR_DATA_MAP_CONTENT();

		for (size_t i = 0; i < VAR_DATA_MAP_CONTENT.GetCount(); i++)
		{
			std::pair<int, int> item = VAR_DATA_MAP_CONTENT.GetAt(i);
			AssignmentField field = (AssignmentField) item.first;
			VAR_DATA_MAP.put(AssignmentFieldClass::getInstance(field), item.second);
		}
	}

	return VAR_DATA_MAP.Lookup(type, value);
}

template<class ARRAY_PTR>
void SetFieldItem(ARRAY_PTR ArrayPtr, FieldMap* fieldMap, FieldType* type, FieldLocation location,
	int fixedDataBlockIndex, int fixedDataOffset, int varDataKey, long mask, int metaBlock)
{
	FieldItemPtr item(
		new FieldItem(fieldMap, type, location, fixedDataBlockIndex, fixedDataOffset, varDataKey, mask, metaBlock)
		);

	(*ArrayPtr)[type->getValue()] = item;
}

